import React from 'react';
import NavDropdown from 'react-bootstrap/NavDropdown';

export default function DropdownCategory() {
    return (
        <>
            <NavDropdown.Item href={`/${category.name}`}>
                {category.name}
            </NavDropdown.Item>
            <NavDropdown.Divider />
        </>
    )
}
